import {
  CardCheckBox,
  CardContent,
  CardDetail,
  CardImg,
  CardTitle,
  CardWrap,
} from '../../styles/dashboard/activityCard.styles';

const ActivityCard = (props) => {
  return (
    <>
      <CardWrap>
        <CardImg>
          <CardCheckBox type="input" />
        </CardImg>
        <CardContent>
          <CardTitle>{props.activity.title}</CardTitle>
          <CardDetail>
          {props.content}
          </CardDetail>
          <CardDetail>작성자:{props.email}</CardDetail>
          <CardDetail>작성일자:{props.createdDate}</CardDetail>
          <CardDetail>좋아요:{props.likel}</CardDetail>
        </CardContent>
      </CardWrap>
    </>
  );
};

export default ActivityCard;
